//Read keyboard info
void PS2_mouse() {

	volatile int* PS2_ptr = (int*)0xFF200100;

	int PS2_data, RVALID;

	PS2_data = *(PS2_ptr);
	RVALID = (PS2_data & 0x8000);
	if (RVALID != 0)
	{
		byte1 = byte2;
		byte2 = byte3;
		byte3 = PS2_data & 0xFF;
	}
	if ((byte2 == 0xAA) && (byte3 == 0x00))
	{
		*(PS2_ptr) = 0xF4;
	}
}

