//config GIC
void config_GIC(void) {
 
	//config timer
    config_interrupt(MPCORE_PRIV_TIMER_IRQ);
    
    *((int *) MPCORE_GIC_CPUIF + ICCICR) = 0xFFFF;
    
    *((int *) MPCORE_GIC_CPUIF + ICCICR) = 0x1;
    
    *((int *) MPCORE_GIC_DIST + ICDDCR) = 0x1;
}

//funtion for config any port
void config_interrupt (int N) {

    int reg_offset, index, value, address;

    reg_offset = (N >> 3) & ~0x3;
    address = MPCORE_GIC_DIST + ICDISER + reg_offset;

    index = N & 0x1F;
    value = 0x1 << index;

    *(int *) address |= value;

    reg_offset = N & ~0x3;

    index = N & 0x3;

    address = MPCORE_GIC_DIST + ICDIPTR + reg_offset + index;
    *(char *) address = (char) 0x1;
}

//set timer
void config_private_timer() {
    volatile int *timer_base_ptr = (int *) MPCORE_PRIV_TIMER;
    volatile int *timer_load_ptr = timer_base_ptr;
    volatile int *timer_ctrl_ptr = timer_base_ptr + 0x2;
    volatile int *timer_acknowledge_ptr = timer_base_ptr + 0x3;
    
	//interrupt every 1 second
    *timer_load_ptr = 200000000;
    *timer_ctrl_ptr = 0x7;
    *timer_acknowledge_ptr = 0x1;
}

//IRQ handler
__attribute__ ((interrupt))
void __cs3_isr_irq(void) {
    volatile int *clear_interrupt_ptr = (int *) (MPCORE_GIC_CPUIF + ICCEOIR);
    volatile int *acknowledge_ptr = (int *) (MPCORE_GIC_CPUIF + ICCIAR);
    int interrupt_id = *acknowledge_ptr;
    if(interrupt_id == 29) {
        timer_isr();
    } else {
        while (1);
    }
    *clear_interrupt_ptr = interrupt_id;
}

//interrupt service for timer
void timer_isr(void) {
    volatile int *timer_base_ptr = (int *) MPCORE_PRIV_TIMER;
    volatile int *timer_acknowledge_ptr = timer_base_ptr + 0x3;
    *timer_acknowledge_ptr = 0x1;
    if(total_game_time > 0) total_game_time--;
    int hundred = total_game_time / 100;
    int ten = (total_game_time - 100 * hundred) /10;
    int one = total_game_time - 100 * hundred - 10 * ten;
    *ADDR_7SEG1 = number[hundred] * 65536 + number[ten] * 256 + number[one];

}

//init interrupt service
void init_IRQ(void) {

    int status;
  
    status = INT_DISABLE | SVC_MODE;
    asm volatile("msr cpsr, %[ps]" : : [ps] "r" (status));
    
    config_GIC();

    config_private_timer();

    status = INT_ENABLE | SVC_MODE;
    asm volatile("msr cpsr, %[ps]" : : [ps] "r" (status));
}
